import React from "react"
import $ from "jquery"

function auth() {
    var email = $("#ed_email").val()
    var password = $("#ed_password").val()
    $.ajax({
        url: "http://localhost:3000/login",
        type: "post",
        dataType: "json",
        contentType: "application/x-www-form-urlencoded",
        data: {
            "email" : email,
            "password" : password
        }
    })
}

export default() =>
<main>
<div style={{display: "grid", background: "white"}}>

        <img src="static/src/Logo_petro.png" id="logo_petro"/>
    </div>


    <form method="post">

    <input
      type = "email"
      name = "email"
      id = "ed_email"
      placeholder = "Email"/>

    <input
      type = "password"
      name = "password"
      id = "ed_password"
      placeholder = "Password"/>

      <div className="regist"><a href='/Registration'>Don't have account? Register Here!</a></div>
      <button className="login">Login</button>
    </form>
<style jsx global>{`
    body {
        background: #3EC400;
