        right: 0;
        margin-top: 1%;
        margin-left: 42.5%;
        display: block;
        font-size: 30px;
        padding: 5px 5px;
    }

    .divPic{
        background: #FFFFFFF;
        width: 100%;
    }

    #logo_petro{
        background: #FFFFFF;
        margin-left: 20%;
    }

    #ed_email{
        width: 28%;
        position: relative;
        right: 0;
        margin-top: 10%;
        margin-left: 36%;
        display: block;
        font-size: 20px;
        border: none;
        border-bottom: 2px inset #000000;
        padding: 10px 10px;
    }

    #ed_password{
        width: 28%;
        position: relative;
        right: 0;
        margin-top: 1%;
